import './App.css';
import Video from './pages/Video';

function App() {
  return (
    <div className="App">
      <div className='app_videos'>
        <Video />
        <Video />
        <blockquote class="tiktok-embed" cite="https://www.tiktok.com/@raficomedian/video/7215691638054718762" data-video-id="7215691638054718762" style="max-width: 605px;min-width: 325px;" > <section> <a target="_blank" title="@raficomedian" href="https://www.tiktok.com/@raficomedian?refer=embed">@raficomedian</a> I am extraordinary! <a title="reels" target="_blank" href="https://www.tiktok.com/tag/reels?refer=embed">#reels</a> <a title="jokes" target="_blank" href="https://www.tiktok.com/tag/jokes?refer=embed">#jokes</a> <a title="standup" target="_blank" href="https://www.tiktok.com/tag/standup?refer=embed">#standup</a> <a title="standupcomedy" target="_blank" href="https://www.tiktok.com/tag/standupcomedy?refer=embed">#standupcomedy</a> <a title="nycomedy" target="_blank" href="https://www.tiktok.com/tag/nycomedy?refer=embed">#nycomedy</a> <a title="fy" target="_blank" href="https://www.tiktok.com/tag/fy?refer=embed">#fy</a> <a title="fyp" target="_blank" href="https://www.tiktok.com/tag/fyp?refer=embed">#fyp</a> <a title="foryoupage" target="_blank" href="https://www.tiktok.com/tag/foryoupage?refer=embed">#foryoupage</a> <a target="_blank" title="♬ original sound - Rafi Bastos" href="https://www.tiktok.com/music/original-sound-7215691641624611627?refer=embed">♬ original sound - Rafi Bastos</a> </section> </blockquote> <script async src="https://www.tiktok.com/embed.js"></script>
        <Video />
      </div>
    </div>
  );
}

export default App;
